import React, { PureComponent } from 'react';

import './App.css';
// import { spreadElement } from '@babel/types';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

// import ScrollToTop from './helper';
import Home from './Home';
import Login from './Login';
import RecordPurchase from './RecordPurchase';
import AnalyzeSpending from './analyzeSpending';
import CelebrateSaving from './CelebrateSaving';

export default class App extends PureComponent {
  render() {
    return (
      <div className="App">
        <Router>
          <Home />
          <div className="btn-space">
              <Link to="/Login" className="login">
            <button className="btn" type="button" id="loginBtn">
                Login/Join
            </button>
              </Link>
              <Link to="/RecordPurchase">
            <button className="btn" type="button" id="recordSpnd">Record Purchase
            </button>
            </Link>
              <Link to="/AnalyzeSpending" className="analyze" onClick={this.makeSpentCards}>
            <button className="btn" type="button" id="analyze">
                Analyze Spending
            </button>
              </Link>
            <Link to="/CelebrateSaving" className="celebrate">
            <button className="btn" type="button" id="save">
              Celebrate Saving
            </button>
            </Link>
          </div>
          <Switch>
            <Route path="/Login" component={Login} />
            <Route exact path="/RecordPurchase" component={RecordPurchase} />
            <Route path="/AnalyzeSpending" component={AnalyzeSpending} />
            <Route path="/CelebrateSaving" component={CelebrateSaving} />
          </Switch>
        </Router>
      </div>
  );
  }
}
